.overlay{
position:absolute;inset:0;
background:radial-gradient(circle,rgba(255,255,255,.15),rgba(0,0,0,.85));
pointer-events:none;
animation:pulse 1.5s infinite;
}
@keyframes pulse{0%{opacity:.6}50%{opacity:1}100%{opacity:.6}}
.container{
position:relative;z-index:2;
height:100%;
display:flex;
flex-direction:column;
justify-content:center;
align-items:center;
color:white;
text-align:center;
}
.logo{position:absolute;top:30px;width:320px;}
.winner{font-size:90px;font-weight:900;margin:20px 0;text-shadow:0 0 40px gold;}
.division{font-size:40px;color:#00e5ff;text-shadow:0 0 20px #00e5ff;}
.count{font-size:140px;color:#ff1744;text-shadow:0 0 40px red;}
button{
font-size:42px;padding:24px 80px;border:none;border-radius:80px;
background:linear-gradient(45deg,#ff1744,#ff9100);color:white;cursor:pointer;
}
.shake{animation:shake .15s infinite;}
@keyframes shake{0%{transform:translate(2px,2px)}50%{transform:translate(-2px,-2px)}100%{transform:translate(2px,2px)}}
</style>
</head>
<body>
